import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { NumericFormat } from 'react-number-format';
// import { AuthContext } from '../Login/AuthContext';
// import { useNavigate } from 'react-router-dom';
const AboutUs = () => {
  const [AboutUs, setAboutUs] = useState([]);
//   const navigate = useNavigate();
  useEffect(() => {
    axios.get('http://26.90.237.200:3000/admin/read')
      .then(response => {
        setAboutUs(response.data);
      })
      .catch(error => {
        console.error(error);
      });

  }, []);

  return (
    <div className="container">
      <div>
        {AboutUs.map((val, idx) => (
          <div className="card" key={idx}>
            <div className="content">
              <p>โครงการ : {val.name}</p>
              <p>ที่อยู่ : {val.address}</p>
              <p>ชื่อ : {val.manager_name}</p>
              <p>นามสกุล : {val.manager_lastname}</p>
              <p>ชื่อบัญชีผู้ใช้ : {val.he_username}</p>
              <p class="" type="password">รหัสผ่าน : {val.he_password}</p>
              <p> อัตตราผ่อน : {val.down_rate}</p>
              <NumericFormat
                value={house.h_price}
                allowLeadingZeros
                thousandSeparator=","
                displayType="text"
                renderText={(value) => <p>{value} บาท</p>}
              />
              <p> เงินส่วนกลาง : {val.common_money}</p>
            
            </div>
            <div className="content">
              <br />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AboutUs;
